  import React,{useState} from 'react'
  // import db from './db';
  import { Link, useNavigate } from 'react-router-dom'

  export default function Concert() {
    //const [RegisterStatus, setRegisterStatus] = useState("");
    const navigate = useNavigate();
    const [values, setValues] = useState({
      name: '',
      email: '',
      username: '',
      password: '',
      
    });
    //const [errors, setErrors] = useState({});
    // const [concertData, setConcertData] = useState([]); // New state to store the retrieved data
  
    const handleSubmit = (e) => {
      e.preventDefault();
  
      fetch("http://localhost:8081/Create", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          name: values.name,
          email: values.email,
          username: values.username,
          password: values.password,
     
        }),
      })
        .then((res) => res.json())
        .then((data) => {
          if (data.message) {
            //setRegisterStatus(data.message);
            navigate('/Created');
          } else {
           // setRegisterStatus("Concert created");
            console.log(data);
            navigate('/Created');
          }
        })
        .catch((error) => {
          console.error("Error:", error);
        });
    };
  
    const handleInput = (event) => {
      setValues((prev) => ({ ...prev, [event.target.name]: event.target.value }));
    };
  
    // useEffect(() => {
    //   // Fetch data when the component mounts
    //   fetch('http://localhost:8081/Created')
    //     .then((res) => res.json())
    //     .then((data) => {
    //       // Update the state with the retrieved data
    //       setConcertData(data);
    //     })
    //     .catch((error) => {
    //       console.error('Error:', error);
    //     });
    // }, []); // Empty dependency array to fetch data only once when the component mounts
  
    return (
      <>
<div className='flex'>
      {/* <div className=' text-center'>
          <div className="btn-group" role="group" aria-label="Basic example">
    <button type="button" className="btn btn-success" > <Link className="nav-link " aria-current="page" to="/Create">Create New Student Registration</Link></button>
    <button type="button" className="btn btn-warning"><Link className="nav-link " aria-current="page" to="/Edit">Edit Student Registration</Link></button>
    <button type="button" className="btn btn-danger"><Link className="nav-link " aria-current="page" to="/Delete">Delete Student Registration</Link></button>
  </div>
  </div> */}

  <form className='center2'>
  <h3 className='colorw text-center'> New Student Registration</h3>

  <table className="table2">
    <thead className='tbody'>
      <tr>
        <th>    <label htmlFor="exampleFormControlInput1" className="form-label mb-3 my-3 mx-3 ">Student Name</label>
</th>
        <th>  
        <input type="text" onChange={handleInput} name='name' className=" my-2  " id="Concert_Name" placeholder="Enter Students Name"/>

</th>
        
       
      </tr>
      <tr>
        <th>
        <label htmlFor="exampleFormControlInput1" className="form-label mb-3 my-3 mx-3">Email</label>
        </th>
        <th>
        <input type="email" onChange={handleInput} name='email' className="my-2 mx-3 " id="Team_Name" placeholder="Enter Email"/>

        </th>
      </tr>
      <tr>
        <th>
        <label htmlFor="exampleFormControlInput1" className=" mb-3 my-3 mx-3 ">Username</label>
        </th>
        <th>
        <input type="text" onChange={handleInput} name='username' className="" id="Ticket_Fee" placeholder="Username"/>

        </th>
      </tr>
      <tr>
        <th>
        <label htmlFor="exampleFormControlInput1" className="form-label mb-3 my-3 mx-5" type="date">Password</label>
        </th>
        <th>
        <input type="password" onChange={handleInput} name='password' className="my-2 mx-1" id="date" placeholder="Enter Password"/>

        </th>
      </tr>
    </thead>
    <tbody className='tbody'>
     
        
 
        
      
    </tbody>
  </table>
  
  <div ><button type="submit" onClick={handleSubmit} className="btn btn-success" >Submit</button>
  </div>

  
  </form>
  </div>
      
      </> 
    )
};
